import { useEffect, useState } from "react";
import "./App.css";
import TableData from "./Components/TableData.js";

const serverName = "http://192.168.31.241";

function App() {
  const [TableData, setTableData] = useState([]);

  const getData=()=>{
    fetch('tableData.json'
    ,{
      headers : { 
        'Content-Type': 'application/json',
        'Accept': 'application/json'
       }
    }
    )
      .then(function(response){
        console.log(response)
        return response.json();
      })
      .then(function(myJson) {
        console.log(myJson);
        setTableData(myJson)
      });
  }
  useEffect(()=>{
    getData()
  },[])

  return (
    <div className="App">
      <div className="header">Table Occupancy System</div>
      <label className="clabel">Sensor Data</label>
      <div className="newRow">
        <TableData name="Zone" data={TableData.Zone} />
        <TableData name="Available" data={TableData.Available} />
        <TableData name="Leaving Soon" data={TableData.LeavingSoon} />
        <TableData name="Occupied" data={TableData.Occupied} />
      </div>
    </div>
  );
}

export default App;
